import React from 'react';

import { Flex, Box } from '../../atoms/layout';

export const Clock: React.FC = () => (
	<Flex
		height="clock"
		width="clock"
		backgroundColor="reds.100"
		borderRadius="100%"
		borderStyle="solid"
		borderWidth={2}
		justifyContent="center"
		alignItems="center"
	>
		<Box height="5px" width="5px" backgroundColor="black" borderRadius="100%" />
	</Flex>
);
